    const getdata = () =>{
        let url = "http://localhost:9999/customer/"+customerid;
        fetch(url)
        .then(responsedata => responsedata.json())
        .then(response => {
            pickData(data)
        })
    }

    useEffect(()=>{
       getdata();
    }, [1])

  return(
     <div className='container'>
           <div className='row'>
                 <div className='col-lg-12 text-center'>
                       <h2>Details</h2>

                 </div>
           </div>
     </div>
  )
}

